import "./navbar.css";

const navbar = () => {
  return (
    <div>
      <div className="row">
        <div className="col">
          <button>Home</button>
        </div>
        <div className="col">
          <button>Login</button>
          <button>Logout</button>
        </div>
        <div className="col">
          <button>Register</button>
        </div>
      </div>
    </div>
  );
};

export default navbar;
